import {
  BrowserRouter as Router,
  Routes,
  Route,
  Outlet,
} from "react-router-dom";




import React from 'react';
import Header from './header';
import PhoneNumber from "./fontpage"



function App() {
  return (
    <Router>
      <Header />
      <Routes>
        <Route path="frontpage" element={<PhoneNumber />} />

      </Routes>
    </Router>
  );
}

export default App;
